/* Generated File Run.js in Project runnable */	function close_runnable(){	Minimizer.close("runnable");}	function minimize_runnable(){	Minimizer.minimize("runnable");}	function maximize_runnable(){	Minimizer.maximize("runnable");}function open_runnable(){}/* Initialize application */			function init_runnable(){	$("#body-runnable").keypress(function(event) {	}).mouseover(function(){	    $("#runnable-container").draggable({disabled:true});    }).mouseout(function(){        $("#runnable-container").draggable({disabled:false});    });		$("#runnable-container").mousedown(function(){		Focus.set("runnable");		setMenu_runnable();			fixSizerunnableSpeed = 0;	})	.mouseup(function(){		fixSizerunnableSpeed = 300;	});		/* Make application resizable */	Resizable.set("runnable");		$("#exit-runnable").mousedown(function(){		close_runnable();		$("#body-runnable").val("");	});	$("#maximize-runnable").mousedown(function(){		maximize_runnable()	});		$("#minimize-runnable").mousedown(function(){		minimize_runnable()	});			fixSize_runnable();}/* Fix size application */var fixSizerunnableSpeed = 300;function fixSize_runnable(){	setTimeout(function(){		if(LoadAppsID["runnable"].onFocus){			height = $("#runnable-container").height();			width = $("#runnable-container").width();			$("#body-runnable").css({"height" : height-45, "width" : width-5});		}		fixSize_runnable();	},fixSizerunnableSpeed);}/* Set application menu */function setMenu_runnable(){	proIdApps = "runnable";	var valMenu = "<span id=top-menu-item0 class=top-menu-item>Runnable</span>"+        "<ul id=top-menu-item0-down class=top-menu-item-down>"+            "<li onclick=minimize_runnable(proIdApps)>Minimize</li>"+			"<li onclick=maximize_runnable(proIdApps)>Maximize</li>"+			"<li onclick=close_runnable(proIdApps)>Quit runnable</li>"+        "</ul>";		$("#top-menu").html(valMenu);		Menu.fixedTopMenu();}/* Register application */function register_runnable(){	$.post("system/applications/runnable/layout/runnable.html", function(data){		ApplicationRun[applicationOpened] = data;		ApplicationRun[applicationOpened] = ApplicationRun[applicationOpened];		$(".program").html(($(".program").html())+ApplicationRun[applicationOpened]);		setTimeout(init_runnable,100);		fixSize_runnable();		applicationOpened++;	});	}/* Running application */function run_runnable(dir, fileName){}